import { Catalog } from './components/Recipe/Catalog';

function App() {
	return (

			   <div id="wrapper">
        <section id="cta" className="jumbotron text-center">
            <div className="container">
                <a href="food-index.html"><img src="/styles/images/version/food-logo.png" alt="" className="img-fluid"/></a>
                <p>Each year we've hosted the Best Food Blog Awards, we're astounded at the depth, variety, creativity, and ingenuity of the food blogs nominated..</p>
                <a href="#" className="btn btn-primary">View Recipes</a>
            </div>
        </section>

        <Header />

		<Catalog />
        <footer className="footer">
            <div className="container">
                <div className="row">
                    <div className="col-lg-8 offset-lg-2">
                        <div className="widget">
                            <div className="footer-text text-center">
                                <a href="food-index.html"><img src="images/version/food-logo.png" alt="" className="img-fluid"/></a>
                                <p>Â© 2017 RecipeList Pty Ltd. Trademarks and brands are the property/of their respective owners. </p>
                                <div className="social">
                                    <a href="#" data-toggle="tooltip" data-placement="bottom" title="Facebook"><i className="fa fa-facebook"></i></a>              
                                    <a href="#" data-toggle="tooltip" data-placement="bottom" title="Twitter"><i className="fa fa-twitter"></i></a>
                                    <a href="#" data-toggle="tooltip" data-placement="bottom" title="Instagram"><i className="fa fa-instagram"></i></a>
                                    <a href="#" data-toggle="tooltip" data-placement="bottom" title="Google Plus"><i className="fa fa-google-plus"></i></a>
                                    <a href="#" data-toggle="tooltip" data-placement="bottom" title="Pinterest"><i className="fa fa-pinterest"></i></a>
                                </div>
                             </div> {/* </div> <!-- end footer-text --> */}
                        </div>  {/*<!-- end widget --> */}
                    </div> { /*<!-- end col --> */}
                </div>

                <div className="row">
                    <div className="col-md-12 text-center">
                        {/* <br> */}
